messages.content:
@everyone  The 11 characters are able to work together with Lex's family (who are, admittedly, a bit confused) to shut down Biotechnica's operations permanently.  Alex sets explosives on the reactor core and blows the building.  Biotechnica, among many things, was the inventor and patent holder for the process to create fuel from genetically-engineered grains (called by its chemical composition, CHOO2 or often just called choo).  With the vacuum left by the destruction of Biotechnica, Lex's family takes control of the patent, and is very financially secure because of it.

The "others" decide to take the group's brand of investigation and battling for the little guy out east, settling into an abandoned YMCA facility in Pittsburgh.  The information on Biotechnica's operation gets into the news (I'd assume Louz leaked it, if that makes sense).  We enter a time for about 5 years where people are very paranoid about the possibility of people they know having been replaced by a clone.  

Over time, Antoni and Case, with the backing of the group, are able to dig out Biotechnica's records  and deal with the remaining clones.  Lex's family is uncertain if they should mourn or not, so they decide to have a celebration of Lex's life.  In her honor, they use the funds from the patent they now hold to design and build a new rugged off-road vehicle designed to handle anything.  They call it a Lexus.
